import React from "react";
import { useFormik } from "formik";
import * as Yup from "yup";

const intialValues = {
  username: "",
  email: "",
  password: "",
  confirmpassword: "",
};
function Login() {
  const formik=useFormik({
    intialValues: intialValues
  })
}
export default Login;
